import "./AboutCTA.css"

const AboutCTA = () =>{
  return(
    <div className="call-to-action">
      <h2>Let's Collaborate!</h2>
      <a href="/contact" className="button-56">Contact Me</a>
    </div>
  )
}

export default AboutCTA;
